import React from 'react';
import './Menu.css'
import LocationLogo from '../../icons/location-icon.svg'

const Menu = () => {

  return(
    <nav className= "menu">
      <p className="heading-one">Send
        <span className="heading-two">News</span>
      </p>

      <p>
      <img className="location-img"
        src={LocationLogo}
        alt="location pin">
      </img>
      Local News
      </p>
    </nav>

  )
}

export default Menu;
